import React, { Component } from 'react'
import { connect } from 'react-redux'
import { logout } from '../../Redux/action'
import { Redirect } from 'react-router-dom'

class UserDashboard extends Component {
    constructor(props){
        super(props)
    }
    handleClick = () => {
        const { logout } = this.props
        logout()
        console.log(this.props)
        // this.props.histroy.push('/login')
    }
    render() {
        const { loginSuccess } = this.props
        console.log(this)
        return (
            <>
                <div className="container-fluid">
                    <div className='m-5'>
                        <nav className="navbar fixed-top navbar-dark p-3 shadow-lg rounded">
                            <p className="font-weight-bold h3">Ticket Management System</p>

                            <div className='float-right'>
                                <span>
                                    <span className="font-weight-bold h3 mr-3">{loginSuccess && loginSuccess.name}</span>
                                    <button className="btn btn-outline-danger" onClick={this.handleClick}>Logout</button>
                                </span>
                            </div>
                        </nav>
                    </div>
                </div>
            </>
        )
    }
}
const mapStateToProps = state => ({
    loginSuccess: state.loginSuccess
});
const mapDispatchToProps = dispatch => ({
    logout: () => dispatch(logout())
});
export default connect(
    mapStateToProps,
    mapDispatchToProps
)(UserDashboard);
